window.bookSummaryJSON = "<p>At some point in our lives, most of us have felt overwhelmed by the number of things we need to do and the lack of time we have to do them. And although technology has advanced by leaps and bounds, giving us new ways to help keep track of our tasks and organize our lives, these technological advancements also bring even more demands on our time.&nbsp;</p> <p>Join Ciara Conlon, leadership and productivity coach, author, and keynote speaker, as she guides you through tried-and-true strategies that will help you set goals, reduce clutter, elevate your productivity, and get more out of every day. Ms. Conlon will provide you with tips, tools, and techniques to help you lessen stress; have more clarity; focus and prioritize; and, above all, get and stay organized.&nbsp;</p> <p>Through this series of 10 lectures, you’ll learn how to effectively set goals and define your priorities; efficiently use technology to control your life instead of letting technology control you; make small and simple changes to your routine, which help increase your energy and your ability to get more accomplished; and avoid common pitfalls such as procrastination, distractions, and interruptions.</p> <p>With these lectures, there’s no need for you either to make big changes in how you work or to learn new technology. Ms. Conlon will introduce you to dozens of little changes that can help you to feel more in control not only of your task list, but also of your life, overall.</p>"; 
